INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(1, 'text', 'PHP (Hypertext Preprocessor) - это популярный серверный язык программирования, специально разработанный для веб-разработки. Он встраивается в HTML и выполняется на сервере, что делает его идеальным для создания динамических веб-страниц.', NULL, NULL, NULL, NULL, NULL, 1, 1, '2025-10-21 08:15:47', '2025-10-21 08:15:47'),
(2, 'code', '<?php\n// Простейшая программа на PHP\necho \"Привет, мир!\";\n\n// Переменные\n$name = \"Иван\";\n$age = 25;\n\n// Условные операторы\nif ($age >= 18) {\n    echo \"$name, вы совершеннолетний\";\n} else {\n    echo \"$name, вы несовершеннолетний\";\n}', NULL, NULL, NULL, NULL, 'php', 2, 1, '2025-10-21 08:15:47', '2025-10-21 08:15:47'),
(3, 'text', 'Одной из ключевых особенностей PHP является его простота для новичков. Язык имеет интуитивно понятный синтаксис и обширную документацию. PHP поддерживает различные базы данных, включая MySQL, PostgreSQL, SQLite.', NULL, NULL, NULL, NULL, NULL, 3, 1, '2025-10-21 08:15:47', '2025-10-21 08:15:47');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(4, 'image', 'Архитектура веб-приложения на PHP', '', 'image/png', 'php-architecture.png', 'Архитектура PHP приложения', NULL, 4, 1, '2025-10-21 08:15:47', '2025-10-21 08:15:47');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(5, 'code', '<?php\n// Работа с массивами\n$fruits = [\"яблоко\", \"банан\", \"апельсин\"];\n\n// Цикл foreach\nforeach ($fruits as $fruit) {\n    echo \"Фрукт: $fruit<br>\";\n}\n\n// Ассоциативный массив\n$person = [\n    \"name\" => \"Мария\",\n    \"age\" => 30,\n    \"city\" => \"Москва\"\n];', NULL, NULL, NULL, NULL, 'php', 5, 1, '2025-10-21 08:15:47', '2025-10-21 08:15:47'),
(6, 'text', 'ECMAScript 2015 (ES6) принес революционные изменения в JavaScript. Новые возможности языка сделали код более читаемым, поддерживаемым и выразительным. Рассмотрим ключевые особенности ES6+.', NULL, NULL, NULL, NULL, NULL, 1, 2, '2025-10-21 08:23:16', '2025-10-21 08:23:16'),
(7, 'code', '// Стрелочные функции (Arrow Functions)\nconst multiply = (a, b) => a * b;\n\n// Параметры по умолчанию\nfunction greet(name = \"Гость\") {\n    return `Привет, ${name}!`;\n}\n\n// Шаблонные строки (Template Literals)\nconst user = { name: \"Алексей\", age: 28 };\nconsole.log(`Пользователь: ${user.name}, возраст: ${user.age}`);', NULL, NULL, NULL, NULL, 'javascript', 2, 2, '2025-10-21 08:23:16', '2025-10-21 08:23:16'),
(8, 'text', 'Деструктуризация позволяет извлекать значения из массивов или объектов в отдельные переменные. Это особенно полезно при работе с функциями, возвращающими несколько значений.', NULL, NULL, NULL, NULL, NULL, 3, 2, '2025-10-21 08:23:16', '2025-10-21 08:23:16'),
(9, 'code', '// Деструктуризация объектов\nconst person = { \n    firstName: \"Иван\", \n    lastName: \"Петров\", \n    age: 25 \n};\n\nconst { firstName, lastName } = person;\nconsole.log(firstName); // \"Иван\"\n\n// Деструктуризация массивов\nconst colors = [\"красный\", \"зеленый\", \"синий\"];\nconst [firstColor, secondColor] = colors;\nconsole.log(firstColor); // \"красный\"', NULL, NULL, NULL, NULL, 'javascript', 4, 2, '2025-10-21 08:23:16', '2025-10-21 08:23:16');
