(11, 'code', '// Классы в ES6\nclass Animal {\n    constructor(name) {\n        this.name = name;\n    }\n    \n    speak() {\n        console.log(`${this.name} издает звук.`);\n    }\n}\n\nclass Dog extends Animal {\n    speak() {\n        console.log(`${this.name} лает.`);\n    }\n}\n\nconst dog = new Dog(\"Бобик\");\ndog.speak(); // \"Бобик лает.\"', NULL, NULL, NULL, NULL, 'javascript', 6, 2, '2025-10-21 08:23:16', '2025-10-21 08:23:16'),
(12, 'text', 'Laravel - один из самых популярных PHP-фреймворков, предоставляющий элегантные инструменты для создания RESTful API. Фреймворк следует архитектурному паттерну MVC и предлагает встроенные решения для аутентификации, валидации и работы с базами данных.', NULL, NULL, NULL, NULL, NULL, 1, 3, '2025-10-21 08:24:47', '2025-10-21 08:24:47'),
(13, 'code', '<?php\n// Маршруты для REST API в routes/api.php\nRoute::apiResource(\"posts\", PostController::class);\n\n// Дополнительные маршруты\nRoute::get(\"posts/{id}/comments\", [PostController::class, \"getComments\"]);\nRoute::post(\"posts/{id}/like\", [PostController::class, \"likePost\"]);', NULL, NULL, NULL, NULL, 'php', 2, 3, '2025-10-21 08:24:47', '2025-10-21 08:24:47'),
(14, 'image', 'Архитектура Laravel MVC', '', 'image/png', 'laravel-mvc.png', 'Архитектура MVC в Laravel', NULL, 3, 3, '2025-10-21 08:24:47', '2025-10-21 08:24:47'),
(15, 'code', '<?php\n// Контроллер для работы с постами\nclass PostController extends Controller\n{\n    public function index()\n    {\n        return Post::with([\"user\", \"comments\"])\n            ->latest()\n            ->paginate(10);\n    }\n    \n    public function store(Request $request)\n    {\n        $validated = $request->validate([\n            \"title\" => \"required|string|max:255\",\n            \"content\" => \"required|string\"\n        ]);\n        \n        $post = auth()->user()->posts()->create($validated);\n        \n        return response()->json($post, 201);\n    }\n}', NULL, NULL, NULL, NULL, 'php', 4, 3, '2025-10-21 08:24:47', '2025-10-21 08:24:47'),
(16, 'text', 'Машинное обучение (Machine Learning) - это подраздел искусственного интеллекта, который позволяет компьютерам обучаться на данных без явного программирования. Алгоритмы ML находят закономерности в данных и используют их для прогнозирования.', NULL, NULL, NULL, NULL, NULL, 1, 4, '2025-10-21 09:25:18', '2025-10-21 09:25:18'),
(17, 'text', 'Основные типы машинного обучения:\n\n1. **Обучение с учителем (Supervised Learning)** - алгоритм обучается на размеченных данных\n2. **Обучение без учителя (Unsupervised Learning)** - алгоритм находит структуры в неразмеченных данных\n3. **Обучение с подкреплением (Reinforcement Learning)** - алгоритм учится через взаимодействие со средой', NULL, NULL, NULL, NULL, NULL, 2, 4, '2025-10-21 09:25:18', '2025-10-21 09:25:18');
