(19, 'code', '# Простой пример линейной регрессии на Python\nimport numpy as np\nfrom sklearn.linear_model import LinearRegression\nfrom sklearn.model_selection import train_test_split\n\n# Генерация данных\nX = np.array([[1], [2], [3], [4], [5]])\ny = np.array([2, 4, 6, 8, 10])\n\n# Разделение на обучающую и тестовую выборки\nX_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.2)\n\n# Создание и обучение модели\nmodel = LinearRegression()\nmodel.fit(X_train, y_train)\n\n# Прогнозирование\npredictions = model.predict(X_test)', NULL, NULL, NULL, NULL, 'python', 4, 4, '2025-10-21 09:25:18', '2025-10-21 09:25:18'),
(20, 'text', 'Ключевые библиотеки Python для машинного обучения:\n\n- **Scikit-learn** - классические алгоритмы ML\n- **TensorFlow/Keras** - глубокое обучение\n- **PyTorch** - исследования в области deep learning\n- **Pandas** - обработка данных\n- **NumPy** - математические операции', NULL, NULL, NULL, NULL, NULL, 5, 4, '2025-10-21 09:25:18', '2025-10-21 09:25:18');
