(22, 'code', '# Классификация с помощью Random Forest\nfrom sklearn.ensemble import RandomForestClassifier\nfrom sklearn.datasets import load_iris\nfrom sklearn.metrics import accuracy_score\n\n# Загрузка данных ирисов Фишера\niris = load_iris()\nX, y = iris.data, iris.target\n\n# Создание модели случайного леса\nclf = RandomForestClassifier(n_estimators=100)\nclf.fit(X, y)\n\n# Оценка точности\naccuracy = clf.score(X, y)\nprint(f\"Точность модели: {accuracy:.2f}\")', NULL, NULL, NULL, NULL, 'python', 7, 4, '2025-10-21 09:25:18', '2025-10-21 09:25:18'),
(23, 'text', 'Оптимизация SQL запросов - критически важный навык для backend-разработчиков. Неоптимальные запросы могут значительно замедлить работу приложения и увеличить нагрузку на базу данных.', NULL, NULL, NULL, NULL, NULL, 1, 5, '2025-10-21 09:25:36', '2025-10-21 09:25:36'),
(24, 'code', '-- Создание индексов для ускорения поиска\nCREATE INDEX idx_users_email ON users(email);\nCREATE INDEX idx_posts_user_id ON posts(user_id);\nCREATE INDEX idx_comments_post_id ON comments(post_id);\n\n-- Оптимизация JOIN запросов\nSELECT \n    u.name,\n    p.title,\n    p.created_at\nFROM users u\nINNER JOIN posts p ON u.id = p.user_id\nWHERE u.active = true\nORDER BY p.created_at DESC;', NULL, NULL, NULL, NULL, 'sql', 2, 5, '2025-10-21 09:25:36', '2025-10-21 09:25:36'),
(25, 'text', 'Лучшие практики оптимизации SQL:\n\n- Всегда используйте EXPLAIN для анализа запросов\n- Создавайте индексы на часто используемых полях\n- Избегайте SELECT * - выбирайте только нужные поля\n- Используйте LIMIT для ограничения результатов\n- Оптимизируйте структуру базы данных через нормализацию', NULL, NULL, NULL, NULL, NULL, 3, 5, '2025-10-21 09:25:36', '2025-10-21 09:25:36'),
(26, 'text', 'React Hooks, представленные в версии 16.8, изменили способ создания компонентов в React. Они позволяют использовать состояние и другие возможности React без написания классов.', NULL, NULL, NULL, NULL, NULL, 1, 6, '2025-10-21 09:30:09', '2025-10-21 09:30:09'),
(27, 'code', 'import React, { useState, useEffect } from \"react\";\n\nfunction Counter() {\n  const [count, setCount] = useState(0);\n  \n  useEffect(() => {\n    document.title = `Вы нажали ${count} раз`;\n  }, [count]); // Зависимость от count\n  \n  return (\n    <div>\n      <p>Вы нажали {count} раз</p>\n      <button onClick={() => setCount(count + 1)}>\n        Нажми на меня\n      </button>\n    </div>\n  );\n}', NULL, NULL, NULL, NULL, 'javascript', 2, 6, '2025-10-21 09:30:09', '2025-10-21 09:30:09'),
(28, 'text', 'Основные встроенные хуки:\n\n- **useState** - управление состоянием компонента\n- **useEffect** - выполнение побочных эффектов\n- **useContext** - доступ к контексту\n- **useReducer** - управление сложным состоянием\n- **useMemo** и **useCallback** - оптимизация производительности', NULL, NULL, NULL, NULL, NULL, 3, 6, '2025-10-21 09:30:09', '2025-10-21 09:30:09');
