(30, 'code', '// Кастомный хук для управления формой\nfunction useForm(initialValues) {\n  const [values, setValues] = useState(initialValues);\n  \n  const handleChange = (event) => {\n    const { name, value } = event.target;\n    setValues(prev => ({\n      ...prev,\n      [name]: value\n    }));\n  };\n  \n  return {\n    values,\n    handleChange,\n    setValues\n  };\n}\n\n// Использование кастомного хука\nfunction LoginForm() {\n  const { values, handleChange } = useForm({\n    email: \"\",\n    password: \"\"\n  });\n  \n  return (\n    <form>\n      <input\n        name=\"email\"\n        value={values.email}\n        onChange={handleChange}\n        placeholder=\"Email\"\n      />\n      <input\n        name=\"password\"\n        type=\"password\"\n        value={values.password}\n        onChange={handleChange}\n        placeholder=\"Пароль\"\n      />\n    </form>\n  );\n}', NULL, NULL, NULL, NULL, 'javascript', 5, 6, '2025-10-21 09:30:09', '2025-10-21 09:30:09'),
(31, 'text', 'Docker - платформа для разработки, доставки и запуска приложений в контейнерах. Контейнеризация позволяет изолировать приложения и их зависимости, обеспечивая consistent environment на всех стадиях разработки.', NULL, NULL, NULL, NULL, NULL, 1, 7, '2025-10-21 09:31:45', '2025-10-21 09:31:45'),
(32, 'code', '# Dockerfile для Node.js приложения\nFROM node:18-alpine\n\n# Установка рабочей директории\nWORKDIR /app\n\n# Копирование package.json и package-lock.json\nCOPY package*.json ./\n\n# Установка зависимостей\nRUN npm ci --only=production\n\n# Копирование исходного кода\nCOPY . .\n\n# Открытие порта\nEXPOSE 3000\n\n# Запуск приложения\nCMD [\"npm\", \"start\"]', NULL, NULL, NULL, NULL, 'dockerfile', 2, 7, '2025-10-21 09:31:45', '2025-10-21 09:31:45');
