(34, 'code', '# docker-compose.yml для веб-приложения\nversion: \"3.8\"\nservices:\n  web:\n    build: .\n    ports:\n      - \"3000:3000\"\n    environment:\n      - NODE_ENV=production\n    depends_on:\n      - db\n  \n  db:\n    image: postgres:13\n    environment:\n      POSTGRES_DB: myapp\n      POSTGRES_USER: user\n      POSTGRES_PASSWORD: password\n    volumes:\n      - postgres_data:/var/lib/postgresql/data\n\nvolumes:\n  postgres_data:', NULL, NULL, NULL, NULL, 'yaml', 4, 7, '2025-10-21 09:31:45', '2025-10-21 09:31:45'),
(35, 'text', 'Алгоритмы сортировки - фундаментальная тема в компьютерных науках. Понимание различных алгоритмов сортировки помогает выбирать оптимальные решения для конкретных задач.', NULL, NULL, NULL, NULL, NULL, 1, 8, '2025-10-21 09:33:15', '2025-10-21 09:33:15');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(36, 'code', '// Пузырьковая сортировка (Bubble Sort)\nfunction bubbleSort(arr) {\n    let n = arr.length;\n    for (let i = 0; i < n - 1; i++) {\n        for (let j = 0; j < n - i - 1; j++) {\n            if (arr[j] > arr[j + 1]) {\n                // Меняем элементы местами\n                [arr[j], arr[j + 1]] = [arr[j + 1], arr[j]];\n            }\n        }\n    }\n    return arr;\n}', NULL, NULL, NULL, NULL, 'javascript', 2, 8, '2025-10-21 09:33:15', '2025-10-21 09:33:15'),
(37, 'text', 'Сравнительная таблица алгоритмов сортировки:\n\n| Алгоритм | Лучший случай | Средний случай | Худший случай | Память |\n|----------|---------------|----------------|---------------|---------|\n| Быстрая | O(n log n) | O(n log n) | O(n²) | O(log n) |\n| Слиянием | O(n log n) | O(n log n) | O(n log n) | O(n) |\n| Пирамидальная | O(n log n) | O(n log n) | O(n log n) | O(1) |\n| Пузырьковая | O(n) | O(n²) | O(n²) | O(1) |', NULL, NULL, NULL, NULL, NULL, 3, 8, '2025-10-21 09:33:15', '2025-10-21 09:33:15');
