(38, 'image', 'Визуализация быстрой сортировки', '', 'image/gif', 'quicksort-visualization.gif', 'Визуализация быстрой сортировки', NULL, 4, 8, '2025-10-21 09:33:15', '2025-10-21 09:33:15');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(39, 'code', '// Быстрая сортировка (Quick Sort)\nfunction quickSort(arr) {\n    if (arr.length <= 1) {\n        return arr;\n    }\n    \n    const pivot = arr[Math.floor(arr.length / 2)];\n    const left = [];\n    const right = [];\n    const equal = [];\n    \n    for (let element of arr) {\n        if (element < pivot) {\n            left.push(element);\n        } else if (element > pivot) {\n            right.push(element);\n        } else {\n            equal.push(element);\n        }\n    }\n    \n    return [...quickSort(left), ...equal, ...quickSort(right)];\n}', NULL, NULL, NULL, NULL, 'javascript', 5, 8, '2025-10-21 09:33:15', '2025-10-21 09:33:15'),
(40, 'text', 'Выбор алгоритма сортировки зависит от конкретной ситуации:\n\n- **Малые наборы данных** - пузырьковая или вставками\n- **Большие наборы** - быстрая или слиянием\n- **Стабильность важна** - слиянием\n- **Ограниченная память** - пирамидальная\n- **Частично отсортированные данные** - вставками', NULL, NULL, NULL, NULL, NULL, 6, 8, '2025-10-21 09:33:15', '2025-10-21 09:33:15'),
(41, 'text', 'Vue.js 3 принес значительные улучшения производительности и новый Composition API. Фреймворк стал быстрее, легче и предлагает лучшую TypeScript поддержку.', NULL, NULL, NULL, NULL, NULL, 1, 9, '2025-10-21 09:44:01', '2025-10-21 09:44:01'),
(42, 'code', '<script setup>\nimport { ref, computed, onMounted } from \'vue\'\n\n// Реактивные данные\nconst count = ref(0)\nconst name = ref(\"\")\n\n// Вычисляемое свойство\nconst greeting = computed(() => {\n  return name.value ? `Привет, ${name.value}!` : \"Привет!\"\n})\n\n// Хуки жизненного цикла\nonMounted(() => {\n  console.log(\"Компонент монтирован\")\n})\n\nfunction increment() {\n  count.value++\n}\n</script>\n\n<template>\n  <div>\n    <h1>{{ greeting }}</h1>\n    <p>Счетчик: {{ count }}</p>\n    <input v-model=\"name\" placeholder=\"Введите имя\">\n    <button @click=\"increment\">Увеличить</button>\n  </div>\n</template>', NULL, NULL, NULL, NULL, 'vue', 2, 9, '2025-10-21 09:44:01', '2025-10-21 09:44:01'),
(43, 'image', 'Архитектура Vue.js 3', '', 'image/png', 'vue3-architecture.png', 'Архитектура Vue.js 3', NULL, 3, 9, '2025-10-21 09:44:01', '2025-10-21 09:44:01'),
(44, 'text', 'Ключевые преимущества Vue.js 3:\n\n- **Composition API** - более гибкая организация кода\n- **Улучшенная производительность** - до 2x быстрее рендеринг\n- **Tree-shaking** - меньший размер бандла\n- **Fragments** - несколько корневых элементов\n- **Teleport** - рендеринг в другом месте DOM\n- **Suspense** - асинхронные компоненты', NULL, NULL, NULL, NULL, NULL, 4, 9, '2025-10-21 09:44:01', '2025-10-21 09:44:01'),
(45, 'text', 'Безопасность веб-приложений - критически важный аспект разработки. OWASP выделяет 10 основных угроз, включая инъекции, XSS, небезопасную аутентификацию и другие.', NULL, NULL, NULL, NULL, NULL, 1, 10, '2025-10-21 09:45:09', '2025-10-21 09:45:09'),
(46, 'code', '<?php\n// НЕПРАВИЛЬНО - уязвимость SQL injection\n$id = $_GET[\"id\"];\n$query = \"SELECT * FROM users WHERE id = \" . $id;\n\n// ПРАВИЛЬНО - подготовленные запросы\n$stmt = $pdo->prepare(\"SELECT * FROM users WHERE id = ?\");\n$stmt->execute([$id]);\n$user = $stmt->fetch();\n\n// Защита от XSS\nfunction escape($data) {\n    return htmlspecialchars($data, ENT_QUOTES, \"UTF-8\");\n}\n\necho \"<div>\" . escape($userInput) . \"</div>\";', NULL, NULL, NULL, NULL, 'php', 2, 10, '2025-10-21 09:45:09', '2025-10-21 09:45:09'),
(47, 'text', 'Основные угрозы безопасности:\n\n1. **SQL Injection** - внедрение SQL кода\n2. **XSS (Cross-Site Scripting)** - выполнение чужого JavaScript\n3. **CSRF (Cross-Site Request Forgery)** - несанкционированные запросы\n4. **Небезопасная аутентификация** - слабые пароли, plain-text хранение\n5. **Небезопасные прямые ссылки на объекты** - доступ к чужим данным', NULL, NULL, NULL, NULL, NULL, 3, 10, '2025-10-21 09:45:09', '2025-10-21 09:45:09');
