(49, 'code', '// Защита от CSRF в Laravel\n<form method=\"POST\" action=\"/profile\">\n    @csrf\n    <input type=\"text\" name=\"name\">\n    <button type=\"submit\">Обновить</button>\n</form>\n\n// Безопасная работа с паролями\n$password = \"user_password\";\n$hashedPassword = password_hash($password, PASSWORD_DEFAULT);\n\n// Проверка пароля\nif (password_verify($inputPassword, $hashedPassword)) {\n    // Пароль верный\n}', NULL, NULL, NULL, NULL, 'php', 5, 10, '2025-10-21 09:45:09', '2025-10-21 09:45:09'),
(50, 'text', 'CSS Grid и Flexbox - современные инструменты для создания макетов веб-страниц. Flexbox идеален для одномерных layout (строка или колонка), а Grid - для двумерных layout (и строки, и колонки одновременно).', NULL, NULL, NULL, NULL, NULL, 1, 11, '2025-10-21 10:08:24', '2025-10-21 10:08:24'),
(51, 'code', '/* Flexbox пример - навигационное меню */\n.nav {\n  display: flex;\n  justify-content: space-between;\n  align-items: center;\n  padding: 1rem;\n  background-color: #333;\n}\n\n.nav-logo {\n  color: white;\n  font-size: 1.5rem;\n}\n\n.nav-links {\n  display: flex;\n  gap: 2rem;\n  list-style: none;\n}\n\n.nav-links a {\n  color: white;\n  text-decoration: none;\n  transition: color 0.3s;\n}\n\n.nav-links a:hover {\n  color: #4CAF50;\n}', NULL, NULL, NULL, NULL, 'css', 2, 11, '2025-10-21 10:08:24', '2025-10-21 10:08:24'),
(52, 'text', 'CSS Grid предоставляет мощные возможности для создания сложных макетов. С помощью grid-template-areas можно визуально проектировать layout, что делает код более читаемым и поддерживаемым.', NULL, NULL, NULL, NULL, NULL, 3, 11, '2025-10-21 10:08:24', '2025-10-21 10:08:24'),
(53, 'code', '/* CSS Grid пример - макет страницы */\n.container {\n  display: grid;\n  grid-template-areas:\n    \"header header header\"\n    \"sidebar content ads\"\n    \"footer footer footer\";\n  grid-template-columns: 1fr 3fr 1fr;\n  grid-template-rows: auto 1fr auto;\n  gap: 20px;\n  min-height: 100vh;\n}\n\n.header { grid-area: header; }\n.sidebar { grid-area: sidebar; }\n.content { grid-area: content; }\n.ads { grid-area: ads; }\n.footer { grid-area: footer; }\n\n/* Адаптивность */\n@media (max-width: 768px) {\n  .container {\n    grid-template-areas:\n      \"header\"\n      \"sidebar\"\n      \"content\"\n      \"ads\"\n      \"footer\";\n    grid-template-columns: 1fr;\n  }\n}', NULL, NULL, NULL, NULL, 'css', 4, 11, '2025-10-21 10:08:24', '2025-10-21 10:08:24'),
(54, 'image', 'Сравнение Flexbox и Grid', '', 'image/png', 'flexbox-vs-grid.png', 'Сравнение Flexbox и CSS Grid', NULL, 5, 11, '2025-10-21 10:08:24', '2025-10-21 10:08:24'),
(55, 'text', 'Unit testing (модульное тестирование) - это процесс проверки отдельных модулей кода на корректность работы. В PHP для этого чаще всего используется фреймворк PHPUnit. Тесты помогают находить ошибки на ранних этапах и обеспечивают стабильность кода при изменениях.', NULL, NULL, NULL, NULL, NULL, 1, 12, '2025-10-21 10:09:42', '2025-10-21 10:09:42'),
(56, 'code', '<?php\n// Простой класс для тестирования\nclass Calculator\n{\n    public function add(float $a, float $b): float\n    {\n        return $a + $b;\n    }\n    \n    public function subtract(float $a, float $b): float\n    {\n        return $a - $b;\n    }\n    \n    public function multiply(float $a, float $b): float\n    {\n        return $a * $b;\n    }\n    \n    public function divide(float $a, float $b): float\n    {\n        if ($b == 0) {\n            throw new InvalidArgumentException(\"Division by zero\");\n        }\n        return $a / $b;\n    }\n}', NULL, NULL, NULL, NULL, 'php', 2, 12, '2025-10-21 10:09:42', '2025-10-21 10:09:42'),
(57, 'code', '<?php\nuse PHPUnit\\Framework\\TestCase;\n\nclass CalculatorTest extends TestCase\n{\n    private Calculator $calculator;\n    \n    protected function setUp(): void\n    {\n        $this->calculator = new Calculator();\n    }\n    \n    public function testAdd(): void\n    {\n        $this->assertEquals(4, $this->calculator->add(2, 2));\n        $this->assertEquals(0, $this->calculator->add(-1, 1));\n        $this->assertEquals(1.5, $this->calculator->add(1, 0.5));\n    }\n    \n    public function testSubtract(): void\n    {\n        $this->assertEquals(2, $this->calculator->subtract(5, 3));\n        $this->assertEquals(-2, $this->calculator->subtract(3, 5));\n    }', NULL, NULL, NULL, NULL, 'php', 3, 12, '2025-10-21 10:09:42', '2025-10-21 10:09:42'),
(58, 'code', '    public function testMultiply(): void\n    {\n        $this->assertEquals(6, $this->calculator->multiply(2, 3));\n        $this->assertEquals(0, $this->calculator->multiply(5, 0));\n        $this->assertEquals(-6, $this->calculator->multiply(2, -3));\n    }\n    \n    public function testDivide(): void\n    {\n        $this->assertEquals(2, $this->calculator->divide(6, 3));\n        $this->assertEquals(0.5, $this->calculator->divide(1, 2));\n    }\n    \n    public function testDivideByZero(): void\n    {\n        $this->expectException(InvalidArgumentException::class);\n        $this->calculator->divide(5, 0);\n    }\n}', NULL, NULL, NULL, NULL, 'php', 4, 12, '2025-10-21 10:09:42', '2025-10-21 10:09:42'),
(59, 'text', 'Лучшие практики unit тестирования:\n\n- **Тестируйте один аспект за раз** - каждый тест должен проверять одну функциональность\n- **Используйте понятные имена** - testDivideByZero лучше чем testDivide1\n- **Изолируйте тесты** - тесты не должны зависеть друг от друга\n- **Покрывайте граничные случаи** - нулевые значения, отрицательные числа, исключительные ситуации\n- **Следите за покрытием кода** - стремитесь к 70-80% покрытия', NULL, NULL, NULL, NULL, NULL, 5, 12, '2025-10-21 10:09:42', '2025-10-21 10:09:42');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(60, 'image', 'Цикл разработки с тестированием', '', 'image/png', 'tdd-cycle.png', 'Цикл разработки через тестирование', NULL, 6, 12, '2025-10-21 10:09:42', '2025-10-21 10:09:42'),
(61, 'text', 'Мобильная разработка охватывает создание приложений для iOS и Android. Существует три основных подхода: нативные приложения, гибридные и кроссплатформенные. Каждый подход имеет свои преимущества и ограничения.', NULL, NULL, NULL, NULL, NULL, 1, 13, '2025-10-21 10:10:36', '2025-10-21 10:10:36'),
(62, 'text', 'Сравнение подходов к мобильной разработке:\n\n**Нативные приложения**\n- iOS: Swift/Objective-C + Xcode\n- Android: Kotlin/Java + Android Studio\n- Плюсы: максимальная производительность, полный доступ к API\n- Минусы: нужно писать два приложения\n\n**Кроссплатформенные**\n- React Native, Flutter, Xamarin\n- Плюсы: один код для обеих платформ\n- Минусы: ограниченный доступ к нативным API\n\n**Гибридные**\n- Ionic, Cordova\n- Плюсы: веб-технологии, быстрая разработка\n- Минусы: низкая производительность', NULL, NULL, NULL, NULL, NULL, 2, 13, '2025-10-21 10:10:36', '2025-10-21 10:10:36'),
(63, 'code', '// React Native - пример компонента\nimport React, { useState } from \"react\";\nimport { View, Text, TextInput, Button, StyleSheet, Alert } from \"react-native\";\n\nconst LoginScreen = () => {\n  const [email, setEmail] = useState(\"\");\n  const [password, setPassword] = useState(\"\");\n  \n  const handleLogin = () => {\n    if (!email || !password) {\n      Alert.alert(\"Ошибка\", \"Заполните все поля\");\n      return;\n    }\n    // Логика авторизации\n    console.log(\"Login attempt:\", { email, password });\n  };\n  \n  return (\n    <View style={styles.container}>\n      <Text style={styles.title}>Вход в приложение</Text>\n      \n      <TextInput\n        style={styles.input}\n        placeholder=\"Email\"\n        value={email}\n        onChangeText={setEmail}\n        keyboardType=\"email-address\"\n        autoCapitalize=\"none\"\n      />\n      \n      <TextInput\n        style={styles.input}\n        placeholder=\"Пароль\"\n        value={password}\n        onChangeText={setPassword}\n        secureTextEntry\n      />\n      \n      <Button title=\"Войти\" onPress={handleLogin} />\n    </View>\n  );\n};\n\nconst styles = StyleSheet.create({\n  container: {\n    flex: 1,\n    justifyContent: \"center\",\n    padding: 20,\n  },\n  title: {\n    fontSize: 24,\n    fontWeight: \"bold\",\n    textAlign: \"center\",\n    marginBottom: 30,\n  },\n  input: {\n    height: 50,\n    borderWidth: 1,\n    borderColor: \"#ccc\",\n    borderRadius: 8,\n    paddingHorizontal: 15,\n    marginBottom: 15,\n  },\n});\n\nexport default LoginScreen;', NULL, NULL, NULL, NULL, 'javascript', 3, 13, '2025-10-21 10:10:36', '2025-10-21 10:10:36'),
(64, 'code', '// Flutter - пример виджета\nimport \"package:flutter/material.dart\";\n\nclass CounterApp extends StatefulWidget {\n  @override\n  _CounterAppState createState() => _CounterAppState();\n}\n\nclass _CounterAppState extends State<CounterApp> {\n  int _counter = 0;\n  \n  void _incrementCounter() {\n    setState(() {\n      _counter++;\n    });\n  }\n  \n  @override\n  Widget build(BuildContext context) {\n    return Scaffold(\n      appBar: AppBar(\n        title: Text(\"Счетчик\"),\n      ),\n      body: Center(\n        child: Column(\n          mainAxisAlignment: MainAxisAlignment.center,\n          children: <Widget>[\n            Text(\n              \"Количество нажатий:\",\n            ),\n            Text(\n              \"$_counter\",\n              style: Theme.of(context).textTheme.headline4,\n            ),\n          ],\n        ),\n      ),\n      floatingActionButton: FloatingActionButton(\n        onPressed: _incrementCounter,\n        tooltip: \"Увеличить\",\n        child: Icon(Icons.add),\n      ),\n    );\n  }\n}', NULL, NULL, NULL, NULL, 'dart', 4, 13, '2025-10-21 10:10:36', '2025-10-21 10:10:36'),
(65, 'text', 'Ключевые аспекты успешного мобильного приложения:\n\n- **User Experience (UX)** - интуитивно понятный интерфейс\n- **Производительность** - быстрая загрузка и отклик\n- **Безопасность** - защита пользовательских данных\n- **Доступность** - поддержка разных размеров экранов и ориентаций\n- **Тестирование** - тестирование на реальных устройствах', NULL, NULL, NULL, NULL, NULL, 5, 13, '2025-10-21 10:10:36', '2025-10-21 10:10:36');
