INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(67, 'code', '// Нативный Android (Kotlin)\nclass MainActivity : AppCompatActivity() {\n    \n    private lateinit var binding: ActivityMainBinding\n    \n    override fun onCreate(savedInstanceState: Bundle?) {\n        super.onCreate(savedInstanceState)\n        binding = ActivityMainBinding.inflate(layoutInflater)\n        setContentView(binding.root)\n        \n        binding.button.setOnClickListener {\n            val intent = Intent(this, DetailActivity::class.java)\n            startActivity(intent)\n        }\n    }\n}\n\n// Нативный iOS (Swift)\nimport UIKit\n\nclass ViewController: UIViewController {\n    \n    @IBOutlet weak var label: UILabel!\n    @IBOutlet weak var button: UIButton!\n    \n    override func viewDidLoad() {\n        super.viewDidLoad()\n        button.addTarget(self, action: #selector(buttonTapped), for: .touchUpInside)\n    }\n    \n    @objc func buttonTapped() {\n        label.text = \"Кнопка нажата!\"\n    }\n}', NULL, NULL, NULL, NULL, 'kotlin', 7, 13, '2025-10-21 10:10:36', '2025-10-21 10:10:36'),
(68, 'text', 'Карьерный рост в IT - это не только технические навыки, но и soft skills, стратегическое планирование и постоянное обучение. Успешная карьера в IT требует комплексного подхода и понимания рынка труда.', NULL, NULL, NULL, NULL, NULL, 1, 14, '2025-10-21 10:11:28', '2025-10-21 10:11:28'),
(69, 'text', 'Типичные карьерные пути в IT:\n\n**Технический путь**\n- Junior Developer → Middle Developer → Senior Developer → Tech Lead → Architect\n\n**Управленческий путь**\n- Developer → Team Lead → Project Manager → Head of Development → CTO\n\n**Специализированный путь**\n- DevOps Engineer, Data Scientist, Security Specialist, UX/UI Designer\n\n**Предпринимательский путь**\n- Developer → Startup Founder → Product Owner → Business Owner', NULL, NULL, NULL, NULL, NULL, 2, 14, '2025-10-21 10:11:28', '2025-10-21 10:11:28');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(70, 'image', 'Карьерная лестница в IT', '', 'image/png', 'career-ladder.png', 'Карьерная лестница в IT индустрии', NULL, 3, 14, '2025-10-21 10:11:28', '2025-10-21 10:11:28');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(71, 'text', 'Ключевые навыки для карьерного роста:\n\n**Технические навыки**\n- Глубокое знание одного или нескольких языков программирования\n- Понимание архитектурных паттернов и best practices\n- Опыт работы с базами данных, API, системами контроля версий\n\n**Soft Skills**\n- Коммуникация: умение объяснять технические концепции\n- Работа в команде: коллаборация и code review\n- Тайм-менеджмент: приоритизация задач\n- Решение проблем: аналитическое мышление\n\n**Стратегические навыки**\n- Понимание бизнес-процессов\n- Умение оценивать технический долг\n- Навыки менторства и обучения', NULL, NULL, NULL, NULL, NULL, 4, 14, '2025-10-21 10:11:28', '2025-10-21 10:11:28'),
(72, 'text', 'Веб-дизайн для разработчиков - это понимание основных принципов UI/UX, которые позволяют создавать не только функциональные, но и эстетически приятные интерфейсы. Даже backend-разработчикам важно понимать основы дизайна.', NULL, NULL, NULL, NULL, NULL, 1, 15, '2025-10-21 10:12:40', '2025-10-21 10:12:40'),
(73, 'text', 'Основные принципы веб-дизайна:\n\n**Контраст** - использование contrasting colors для важных элементов\n**Выравнивание** - соблюдение сетки и выравнивание элементов\n**Повторение** - consistent стиль throughout приложения\n**Близость** - группировка связанных элементов together\n\n**Типографика**\n- Используйте не более 2-3 шрифтов\n- Соблюдайте иерархию заголовков\n- Оптимальный line-height: 1.4-1.6\n\n**Цветовая схема**\n- Primary, secondary и accent colors\n- Соответствие бренду\n- Доступность для color blind users', NULL, NULL, NULL, NULL, NULL, 2, 15, '2025-10-21 10:12:40', '2025-10-21 10:12:40'),
(74, 'code', '/* CSS переменные для дизайн-системы */\n:root {\n  /* Цвета */\n  --primary-color: #2563eb;\n  --secondary-color: #64748b;\n  --success-color: #10b981;\n  --warning-color: #f59e0b;\n  --error-color: #ef4444;\n  \n  /* Типографика */\n  --font-family: \"Inter\", sans-serif;\n  --font-size-sm: 0.875rem;\n  --font-size-base: 1rem;\n  --font-size-lg: 1.125rem;\n  --font-size-xl: 1.25rem;\n  \n  /* Отступы */\n  --spacing-xs: 0.25rem;\n  --spacing-sm: 0.5rem;\n  --spacing-md: 1rem;\n  --spacing-lg: 1.5rem;\n  --spacing-xl: 2rem;\n  \n  /* Тени */\n  --shadow-sm: 0 1px 2px 0 rgb(0 0 0 / 0.05);\n  --shadow-md: 0 4px 6px -1px rgb(0 0 0 / 0.1);\n  --shadow-lg: 0 10px 15px -3px rgb(0 0 0 / 0.1);\n}\n\n/* Компонент кнопки */\n.btn {\n  display: inline-flex;\n  align-items: center;\n  justify-content: center;\n  padding: var(--spacing-sm) var(--spacing-md);\n  border: none;\n  border-radius: 6px;\n  font-family: var(--font-family);\n  font-size: var(--font-size-base);\n  font-weight: 500;\n  text-decoration: none;\n  cursor: pointer;\n  transition: all 0.2s;\n}\n\n.btn-primary {\n  background-color: var(--primary-color);\n  color: white;\n}\n\n.btn-primary:hover {\n  background-color: #1d4ed8;\n  transform: translateY(-1px);\n}', NULL, NULL, NULL, NULL, 'css', 3, 15, '2025-10-21 10:12:40', '2025-10-21 10:12:40'),
(75, 'image', 'Дизайн-система компонентов', '', 'image/png', 'design-system.png', 'Дизайн-система UI компонентов', NULL, 4, 15, '2025-10-21 10:12:40', '2025-10-21 10:12:40'),
(76, 'text', 'Инструменты для разработчиков в дизайне:\n\n**Прототипирование**\n- Figma - collaborative design tool\n- Adobe XD - vector-based tool\n- Sketch - macOS only solution\n\n**Inspiration**\n- Dribbble - design community\n- Behance - creative work showcase\n- Awwwards - best websites gallery\n\n**Development Handoff**\n- Zeplin - design to code\n- Avocode - export assets\n- Storybook - component documentation\n\n**Accessibility**\n- WAVE - web accessibility evaluation\n- axe - accessibility testing\n- Lighthouse - performance & accessibility audit', NULL, NULL, NULL, NULL, NULL, 5, 15, '2025-10-21 10:12:40', '2025-10-21 10:12:40'),
(77, 'text', 'Python предлагает множество продвинутых возможностей, которые делают код более выразительным, эффективным и поддерживаемым. От декораторов до асинхронного программирования - эти фичи отличают опытных разработчиков от новичков.', NULL, NULL, NULL, NULL, NULL, 1, 16, '2025-10-21 10:13:13', '2025-10-21 10:13:13'),
(78, 'code', '# Декораторы - мощный инструмент для модификации функций\nimport time\nfrom functools import wraps\n\ndef timer(func):\n    \"\"\"Декоратор для измерения времени выполнения функции\"\"\"\n    @wraps(func)\n    def wrapper(*args, **kwargs):\n        start_time = time.time()\n        result = func(*args, **kwargs)\n        end_time = time.time()\n        print(f\"{func.__name__} выполнена за {end_time - start_time:.4f} секунд\")\n        return result\n    return wrapper\n\ndef cache(func):\n    \"\"\"Декоратор для кэширования результатов функции\"\"\"\n    cached_results = {}\n    \n    @wraps(func)\n    def wrapper(*args, **kwargs):\n        key = str(args) + str(kwargs)\n        if key not in cached_results:\n            cached_results[key] = func(*args, **kwargs)\n        return cached_results[key]\n    return wrapper\n\n@timer\n@cache\ndef fibonacci(n):\n    \"\"\"Вычисление n-го числа Фибоначчи\"\"\"\n    if n <= 1:\n        return n\n    return fibonacci(n-1) + fibonacci(n-2)\n\n# Использование\nprint(fibonacci(10))  # Быстро благодаря кэшированию', NULL, NULL, NULL, NULL, 'python', 2, 16, '2025-10-21 10:13:13', '2025-10-21 10:13:13'),
(79, 'code', '# Генераторы и итераторы\nclass FibonacciIterator:\n    \"\"\"Итератор для последовательности Фибоначчи\"\"\"\n    def __init__(self, max_count):\n        self.max_count = max_count\n        self.count = 0\n        self.a, self.b = 0, 1\n    \n    def __iter__(self):\n        return self\n    \n    def __next__(self):\n        if self.count >= self.max_count:\n            raise StopIteration\n        \n        if self.count == 0:\n            result = self.a\n        else:\n            result = self.a\n            self.a, self.b = self.b, self.a + self.b\n        \n        self.count += 1\n        return result\n\n# Генераторная функция\ndef fibonacci_generator(max_count):\n    \"\"\"Генератор для последовательности Фибоначчи\"\"\"\n    a, b = 0, 1\n    count = 0\n    while count < max_count:\n        yield a\n        a, b = b, a + b\n        count += 1\n\n# Использование\nprint(\"Итератор:\", list(FibonacciIterator(5)))\nprint(\"Генератор:\", list(fibonacci_generator(5)))', NULL, NULL, NULL, NULL, 'python', 3, 16, '2025-10-21 10:13:13', '2025-10-21 10:13:13'),
(80, 'code', '# Контекстные менеджеры\nfrom contextlib import contextmanager\n\n@contextmanager\ndef database_connection(db_url):\n    \"\"\"Контекстный менеджер для работы с базой данных\"\"\"\n    connection = None\n    try:\n        print(f\"Подключаемся к {db_url}\")\n        connection = f\"Connection to {db_url}\"  # Имитация подключения\n        yield connection\n        print(\"Коммитим изменения\")\n    except Exception as e:\n        print(f\"Ошибка: {e}\")\n        print(\"Откатываем изменения\")\n    finally:\n        if connection:\n            print(\"Закрываем соединение\")\n\n# Использование\nwith database_connection(\"postgresql://localhost/mydb\") as conn:\n    print(f\"Используем соединение: {conn}\")\n    print(\"Выполняем запросы...\")\n\n# Встроенные контекстные менеджеры\nwith open(\"file.txt\", \"w\") as f:\n    f.write(\"Hello, World!\")\n# Файл автоматически закрывается', NULL, NULL, NULL, NULL, 'python', 4, 16, '2025-10-21 10:13:13', '2025-10-21 10:13:13'),
(81, 'text', 'Метаклассы и абстрактные базовые классы (ABC) предоставляют возможности для создания более строгих интерфейсов и кастомного поведения классов.', NULL, NULL, NULL, NULL, NULL, 5, 16, '2025-10-21 10:13:13', '2025-10-21 10:13:13'),
(82, 'code', '# Абстрактные базовые классы и метаклассы\nfrom abc import ABC, abstractmethod\nfrom typing import Dict, Any\n\nclass SingletonMeta(type):\n    \"\"\"Метакласс для реализации паттерна Singleton\"\"\"\n    _instances: Dict[type, Any] = {}\n    \n    def __call__(cls, *args, **kwargs):\n        if cls not in cls._instances:\n            cls._instances[cls] = super().__call__(*args, **kwargs)\n        return cls._instances[cls]\n\nclass Repository(ABC):\n    \"\"\"Абстрактный базовый класс для репозиториев\"\"\"\n    \n    @abstractmethod\n    def get_by_id(self, id: int):\n        pass\n    \n    @abstractmethod\n    def save(self, entity):\n        pass\n    \n    @abstractmethod\n    def delete(self, id: int):\n        pass\n\nclass UserRepository(Repository, metaclass=SingletonMeta):\n    \"\"\"Конкретная реализация репозитория пользователей\"\"\"\n    \n    def __init__(self):\n        self._storage = {}\n    \n    def get_by_id(self, id: int):\n        return self._storage.get(id)\n    \n    def save(self, user):\n        self._storage[user.id] = user\n    \n    def delete(self, id: int):\n        if id in self._storage:\n            del self._storage[id]\n\n# Использование\nrepo1 = UserRepository()\nrepo2 = UserRepository()\nprint(repo1 is repo2)  # True - один и тот же экземпляр', NULL, NULL, NULL, NULL, 'python', 6, 16, '2025-10-21 10:13:13', '2025-10-21 10:13:13'),
(83, 'text', 'Нормализация баз данных - это процесс организации данных в таблицы для уменьшения избыточности и улучшения целостности данных. Нормальные формы (1NF, 2NF, 3NF, BCNF) представляют собой последовательные шаги по оптимизации структуры базы данных.', NULL, NULL, NULL, NULL, NULL, 1, 17, '2025-10-21 10:14:38', '2025-10-21 10:14:38'),
(84, 'text', 'Нормальные формы:\n\n**Первая нормальная форма (1NF)**\n- Все атрибуты атомарны (неделимы)\n- Нет повторяющихся групп\n- У каждой таблицы есть первичный ключ\n\n**Вторая нормальная форма (2NF)**\n- Соответствует 1NF\n- Все неключевые атрибуты полностью зависят от первичного ключа\n\n**Третья нормальная форма (3NF)**\n- Соответствует 2NF\n- Нет транзитивных зависимостей (неключевые атрибуты не зависят от других неключевых атрибутов)\n\n**BCNF (Boyce-Codd Normal Form)**\n- Более строгая версия 3NF\n- Каждая детерминанта является потенциальным ключом', NULL, NULL, NULL, NULL, NULL, 2, 17, '2025-10-21 10:14:38', '2025-10-21 10:14:38'),
(85, 'code', '-- Пример нормализации: от денормализованной таблицы к 3NF\n\n-- Исходная денормализованная таблица\nCREATE TABLE denormalized_orders (\n    order_id INT PRIMARY KEY,\n    customer_name VARCHAR(100),\n    customer_email VARCHAR(100),\n    customer_phone VARCHAR(20),\n    product_name VARCHAR(100),\n    product_category VARCHAR(50),\n    product_price DECIMAL(10,2),\n    quantity INT,\n    order_date DATE,\n    total_amount DECIMAL(10,2)\n);\n\n-- После нормализации до 3NF:\n\n-- Таблица заказов\nCREATE TABLE orders (\n    order_id INT PRIMARY KEY,\n    customer_id INT,\n    order_date DATE,\n    total_amount DECIMAL(10,2),\n    FOREIGN KEY (customer_id) REFERENCES customers(customer_id)\n);\n\n-- Таблица клиентов\nCREATE TABLE customers (\n    customer_id INT PRIMARY KEY,\n    customer_name VARCHAR(100),\n    email VARCHAR(100),\n    phone VARCHAR(20)\n);\n\n-- Таблица продуктов\nCREATE TABLE products (\n    product_id INT PRIMARY KEY,\n    product_name VARCHAR(100),\n    category_id INT,\n    price DECIMAL(10,2),\n    FOREIGN KEY (category_id) REFERENCES categories(category_id)\n);\n\n-- Таблица категорий\nCREATE TABLE categories (\n    category_id INT PRIMARY KEY,\n    category_name VARCHAR(50)\n);\n\n-- Таблица элементов заказа\nCREATE TABLE order_items (\n    order_id INT,\n    product_id INT,\n    quantity INT,\n    unit_price DECIMAL(10,2),\n    PRIMARY KEY (order_id, product_id),\n    FOREIGN KEY (order_id) REFERENCES orders(order_id),\n    FOREIGN KEY (product_id) REFERENCES products(product_id)\n);', NULL, NULL, NULL, NULL, 'sql', 3, 17, '2025-10-21 10:14:38', '2025-10-21 10:14:38'),
(86, 'image', 'Процесс нормализации базы данных', '', 'image/png', 'database-normalization.png', 'Процесс нормализации базы данных', NULL, 4, 17, '2025-10-21 10:14:38', '2025-10-21 10:14:38'),
(87, 'text', 'Laravel Eloquent ORM предоставляет элегантный способ работы с отношениями между таблицами базы данных. Понимание и правильное использование отношений - ключевой навык для эффективной работы с Laravel.', NULL, NULL, NULL, NULL, NULL, 1, 18, '2025-10-21 10:19:13', '2025-10-21 10:19:13'),
(88, 'code', '<?php\n// Модель User с различными отношениями\nclass User extends Model\n{\n    // One-to-One: у пользователя один профиль\n    public function profile()\n    {\n        return $this->hasOne(Profile::class);\n    }\n    \n    // One-to-Many: у пользователя много постов\n    public function posts()\n    {\n        return $this->hasMany(Post::class);\n    }\n    \n    // Many-to-Many: пользователь может иметь много ролей\n    public function roles()\n    {\n        return $this->belongsToMany(Role::class);\n    }\n    \n    // Has-Many-Through: посты через блог\n    public function blogPosts()\n    {\n        return $this->hasManyThrough(Post::class, Blog::class);\n    }\n    \n    // Polymorphic: пользователь может комментировать разные сущности\n    public function comments()\n    {\n        return $this->morphMany(Comment::class, \"commentable\");\n    }\n}', NULL, NULL, NULL, NULL, 'php', 2, 18, '2025-10-21 10:19:13', '2025-10-21 10:19:13');
INSERT INTO `sections` (`id`, `type`, `content`, `image_base64`, `image_mime_type`, `image_name`, `image_alt`, `language`, `order`, `material_id`, `created_at`, `updated_at`) VALUES
(89, 'code', '<?php\n// Модель Post с обратными отношениями\nclass Post extends Model\n{\n    // Обратное отношение One-to-Many\n    public function user()\n    {\n        return $this->belongsTo(User::class);\n    }\n    \n    // Many-to-Many с тегами\n    public function tags()\n    {\n        return $this->belongsToMany(Tag::class);\n    }\n    \n    // Polymorphic отношения для лайков\n    public function likes()\n    {\n        return $this->morphMany(Like::class, \"likeable\");\n    }\n    \n    // Отношение с условием\n    public function publishedComments()\n    {\n        return $this->hasMany(Comment::class)->where(\"status\", \"published\");\n    }\n    \n    // Eager loading по умолчанию\n    protected $with = [\"user\", \"tags\"];\n}\n\n// Модель для полиморфных комментариев\nclass Comment extends Model\n{\n    public function commentable()\n    {\n        return $this->morphTo();\n    }\n    \n    public function user()\n    {\n        return $this->belongsTo(User::class);\n    }\n}', NULL, NULL, NULL, NULL, 'php', 3, 18, '2025-10-21 10:19:13', '2025-10-21 10:19:13'),
(90, 'code', '<?php\n// Использование отношений в контроллерах\nclass PostController extends Controller\n{\n    public function index()\n    {\n        // Eager loading для избежания N+1 проблемы\n        $posts = Post::with([\"user\", \"tags\", \"comments.user\"])\n            ->latest()\n            ->paginate(10);\n        \n        return view(\"posts.index\", compact(\"posts\"));\n    }\n    \n    public function show(Post $post)\n    {\n        // Автоматическое разрешение модели через route model binding\n        $post->load([\"user.profile\", \"tags\", \"comments.user\"]);\n        \n        return view(\"posts.show\", compact(\"post\"));\n    }\n    \n    public function store(Request $request)\n    {\n        $validated = $request->validate([\n            \"title\" => \"required|string|max:255\",\n            \"content\" => \"required|string\",\n            \"tags\" => \"array\",\n            \"tags.*\" => \"exists:tags,id\"\n        ]);\n        \n        // Создание поста с отношениями\n        $post = auth()->user()->posts()->create($validated);\n        \n        // Прикрепление тегов (Many-to-Many)\n        if ($request->has(\"tags\")) {\n            $post->tags()->attach($request->tags);\n        }\n        \n        return redirect()->route(\"posts.show\", $post);\n    }\n}', NULL, NULL, NULL, NULL, 'php', 4, 18, '2025-10-21 10:19:13', '2025-10-21 10:19:13'),
(91, 'image', 'Диаграмма отношений Eloquent', '', 'image/png', 'eloquent-relationships.png', 'Диаграмма отношений Eloquent ORM', NULL, 5, 18, '2025-10-21 10:19:13', '2025-10-21 10:19:13'),
(92, 'text', 'Асинхронное программирование в JavaScript эволюционировало от callback hell через Promises до современных async/await. Понимание асинхронности критически важно для создания отзывчивых веб-приложений.', NULL, NULL, NULL, NULL, NULL, 1, 19, '2025-10-21 10:20:46', '2025-10-21 10:20:46'),
(93, 'code', '// Эволюция асинхронного JavaScript\n\n// 1. Callback Hell (ад обратных вызовов)\nfunction getUserData(userId, callback) {\n    getUser(userId, (user) => {\n        getPosts(user.id, (posts) => {\n            getComments(posts[0].id, (comments) => {\n                callback({ user, posts, comments });\n            });\n        });\n    });\n}\n\n// 2. Promises (обещания)\nfunction getUserData(userId) {\n    return getUser(userId)\n        .then(user => {\n            return Promise.all([\n                user,\n                getPosts(user.id),\n                getComments(user.id)\n            ]);\n        })\n        .then(([user, posts, comments]) => {\n            return { user, posts, comments };\n        })\n        .catch(error => {\n            console.error(\"Ошибка:\", error);\n        });\n}', NULL, NULL, NULL, NULL, 'javascript', 2, 19, '2025-10-21 10:20:46', '2025-10-21 10:20:46'),
(94, 'code', '// 3. Async/Await (современный подход)\nasync function getUserData(userId) {\n    try {\n        const user = await getUser(userId);\n        const [posts, comments] = await Promise.all([\n            getPosts(user.id),\n            getComments(user.id)\n        ]);\n        \n        return { user, posts, comments };\n    } catch (error) {\n        console.error(\"Ошибка получения данных:\", error);\n        throw error;\n    }\n}\n\n// 4. Использование с обработкой ошибок\nasync function displayUserData(userId) {\n    try {\n        const data = await getUserData(userId);\n        console.log(\"Данные пользователя:\", data);\n        return data;\n    } catch (error) {\n        console.error(\"Не удалось загрузить данные:\", error);\n        return null;\n    }\n}\n\n// 5. Параллельное выполнение\nasync function loadDashboard() {\n    const [user, notifications, messages] = await Promise.all([\n        getUser(1),\n        getNotifications(1),\n        getMessages(1)\n    ]);\n    \n    return { user, notifications, messages };\n}', NULL, NULL, NULL, NULL, 'javascript', 3, 19, '2025-10-21 10:20:46', '2025-10-21 10:20:46'),
(95, 'text', 'Продвинутые техники асинхронного программирования:', NULL, NULL, NULL, NULL, NULL, 4, 19, '2025-10-21 10:20:46', '2025-10-21 10:20:46'),
(96, 'code', '// Отмена асинхронных операций с AbortController\nasync function fetchWithTimeout(url, timeout = 5000) {\n    const controller = new AbortController();\n    const timeoutId = setTimeout(() => controller.abort(), timeout);\n    \n    try {\n        const response = await fetch(url, {\n            signal: controller.signal\n        });\n        clearTimeout(timeoutId);\n        return await response.json();\n    } catch (error) {\n        clearTimeout(timeoutId);\n        if (error.name === \"AbortError\") {\n            throw new Error(\"Запрос отменен по таймауту\");\n        }\n        throw error;\n    }\n}\n\n// Ограничение параллельных запросов\nclass RequestQueue {\n    constructor(maxConcurrent = 3) {\n        this.maxConcurrent = maxConcurrent;\n        this.queue = [];\n        this.active = 0;\n    }\n    \n    async enqueue(requestFn) {\n        return new Promise((resolve, reject) => {\n            this.queue.push({ requestFn, resolve, reject });\n            this.process();\n        });\n    }\n    \n    async process() {\n        if (this.active >= this.maxConcurrent || this.queue.length === 0) {\n            return;\n        }\n        \n        this.active++;\n        const { requestFn, resolve, reject } = this.queue.shift();\n        \n        try {\n            const result = await requestFn();\n            resolve(result);\n        } catch (error) {\n            reject(error);\n        } finally {\n            this.active--;\n            this.process();\n        }\n    }\n}\n\n// Использование очереди\nconst queue = new RequestQueue(2);\nconst results = await Promise.all([\n    queue.enqueue(() => fetch(\"/api/users/1\")),\n    queue.enqueue(() => fetch(\"/api/users/2\")),\n    queue.enqueue(() => fetch(\"/api/users/3\"))\n]);', NULL, NULL, NULL, NULL, 'javascript', 5, 19, '2025-10-21 10:20:46', '2025-10-21 10:20:46');
