(98, 'text', 'DevOps - это культура и практики, которые объединяют разработку (Development) и эксплуатацию (Operations). Для небольших команд внедрение DevOps практик может значительно улучшить процесс доставки программного обеспечения.', NULL, NULL, NULL, NULL, NULL, 1, 20, '2025-10-21 10:23:58', '2025-10-21 10:23:58'),
(99, 'code', '# GitHub Actions workflow для CI/CD\nname: Deploy to Production\n\non:\n  push:\n    branches: [ main ]\n  pull_request:\n    branches: [ main ]\n\njobs:\n  test:\n    runs-on: ubuntu-latest\n    \n    steps:\n    - uses: actions/checkout@v3\n    \n    - name: Setup Node.js\n      uses: actions/setup-node@v3\n      with:\n        node-version: \"18\"\n        cache: \"npm\"\n    \n    - name: Install dependencies\n      run: npm ci\n    \n    - name: Run tests\n      run: npm test\n    \n    - name: Run linting\n      run: npm run lint\n\n  deploy:\n    needs: test\n    runs-on: ubuntu-latest\n    if: github.ref == \"refs/heads/main\"\n    \n    steps:\n    - uses: actions/checkout@v3\n    \n    - name: Deploy to production\n      run: |\n        echo \"Deploying to production...\"\n        # Команды деплоя\n        rsync -avz ./ user@server:/var/www/app/', NULL, NULL, NULL, NULL, 'yaml', 2, 20, '2025-10-21 10:23:58', '2025-10-21 10:23:58'),
(100, 'text', 'Ключевые DevOps практики для небольших команд:\n\n**Непрерывная интеграция (CI)**\n- Автоматические тесты при каждом коммите\n- Статический анализ кода\n- Сборка артефактов\n\n**Непрерывная доставка (CD)**\n- Автоматический деплой после успешных тестов\n- Blue-green deployments\n- Canary releases\n\n**Инфраструктура как код (IaC)**\n- Terraform для облачных ресурсов\n- Ansible для конфигурации серверов\n- Docker для контейнеризации\n\n**Мониторинг и логирование**\n- Prometheus для метрик\n- Grafana для визуализации\n- ELK Stack для логов', NULL, NULL, NULL, NULL, NULL, 3, 20, '2025-10-21 10:23:58', '2025-10-21 10:23:58');
